$templateCache.put("easyToDoBusiness/food-training/static/supervisor-training.html","<div class=\"row\"><div class=\"col-lg-12\"><a class=\"btn btn-default\" ui-sref=\"etb.foodSafetyTraining\">Exit task</a><snsw-page-heading title=\"Task 1: Appoint a food safety supervisor\"></snsw-page-heading><h3>Introduction</h3><p>A food safety supervisor (FSS) is trained to recognise and prevent risks associated with food handling in a retail food business.</p><p>You need to appoint a food safety supervisor (FSS) if your business is going to prepare and sell food or drinks that are:</p><ul><li>ready to eat or drink</li><li>potentially hazardous (that is, temperature-controlled), and</li><li>not sold or served in the supplier’s original packaging.</li></ul><p>Your FSS will need to be trained by an approved registered training organisation (RTO).</p><h3>What you’ll need</h3><p>You’ll need to appoint an FSS at your business who:</p><ul><li>is trained by an RTO to recognise and prevent risks associated with food handling in a retail food business</li><li>holds a current food safety supervisor certificate which is less than 5 years old</li><li>is not a supervisor for any other food business (fixed or mobile), and</li><li>is able to train and supervise other people in your business about safe food handling practices.</li></ul><h3>How to complete this task</h3><ol><li>Choose an FSS for your business.</li><li>Find an RTO through the <a href=\"http://www.foodauthority.nsw.gov.au/rp/fss-food-safety-supervisors\" target=\"_blank\">NSW Food Authority website</a></li><li>Have the FSS demonstrate the required competency skills through an RTO.</li><li>The RTO will give the FSS a Statement of Attainment and an FSS Certificate.</li><li>Keep the FSS Certificate at your place of business at all times.</li><li>Make sure the FSS gets refresher training from an RTO every 5 years.</li></ol><h3>Things to keep in mind….</h3><p>You can be fined a penalty for not appointing an FSS, and for not keeping your FSS certificate at your place of business</p><h3>Next steps</h3><p>After appointing your FSS, they should help your business to <a href=\"http://www.foodauthority.nsw.gov.au/rp/inspections\" target=\"_blank\">prepare for a food safety inspection</a></p><h3>Need Help?</h3><p>We can help you with this transaction. Feel free to call us on <a href=\"tel:137788\">13 77 88</a></p></div></div>");
