$templateCache.put("easyToDoBusiness/liquor-notify-community/static/etb-liquor-community-finalise.html","<div class=\"row\"><div class=\"col-lg-12\"><a class=\"btn btn-default\" ui-sref=\"etb.liquorNotifyCommunity\">Exit task</a><snsw-page-heading title=\"Finalise application\"></snsw-page-heading><h3>What you have completed</h3><p>As part of notifying the community, you should have completed the following:</p><ol><li>Notice of Intention form</li><li>Community Impact Statement application</li><li>Uploaded and submitted all supporting documentation</li></ol><h3>What Next</h3><p>Your Small Business Enablement Representative will review your application and attachments and will contact you &lt;within ?? days&gt; for any outstanding requirements, and to outline your next steps.</p><p>You can begin to prepare for “Post Construction Inspection”</p><h3>Need Help?</h3><p>Call your Small Business Enablement Team on 1800 123 456</p></div></div>");
$templateCache.put("easyToDoBusiness/liquor-notify-community/static/etb-liquor-community-impact.html","<div class=\"row\"><div class=\"col-lg-12\"><a class=\"btn btn-default\" ui-sref=\"etb.liquorNotifyCommunity\">Exit task</a><snsw-page-heading title=\"Task 2: Prepare a Community Impact Statement\"></snsw-page-heading><h3>Introduction</h3><p>As a potential licence holder of a restaurant or cafe, it’s your responsibility to talk to your local community about any concerns people may have with your application for a liquor licence. And if you’re intending to apply for extended trading hours, or to sell liquor without meals, you’ll have to prepare a Community Impact Statement (CIS). Your CIS will need to summarise any potentially negative aspects your licence might have on the neighbourhood, and outline how you will handle any community issues. It must also describe any changes you’ve made to your initial proposal, after talking with your community.</p><h3>What you’ll need</h3><p>To complete your CIS application, you’ll need to have the following information available:</p><ul><li>whom you consulted with in your local community</li><li>how you conducted the consultation</li><li>the issues or concerns raised by the community, and</li><li>how you will deal with the issues or concerns raised.</li></ul><h3>How to prepare</h3><ol><li>Complete and submit the CIS application form to us for review.</li><li>Consult with us if any additional items are required.</li><li>Receive the completed form via email, for your final review</li><li>Print and sign the form.</li><li>Scan and send to us via email.</li></ol><p>Once we receive your completed and signed form, we’ll submit it to Liquor & Gaming NSW on your behalf, as part of your <a ui-sref=\"etb.liquorCafe\">on-premises liquor licence application</a>.</p><h3>Things to keep in mind...</h3><ul><li>If you couldn’t reach a resolution with the community, your CIS must note the issues, and include a brief description of your attempts to settle them.</li><li>It’s important to make sure all information in your CIS truly reflects the community responses, as it will go on public display.</li></ul><h3>Next steps</h3><p>Once your Liquor Licence application has been received, it will be uploaded to the Liquor & Gaming Noticeboard for 30 days.</p><h3>Need Help?</h3><p>We can help you with this transaction. Feel free to call us on <a href=\"tel:137788\">13 77 88</a></p><p><a ui-sref=\"etb.form({activityName:\'liquorCommunityImpactFormService\', returnState: \'etb.liquorNotifyCommunity\'})\" class=\"btn btn-lg btn-primary pull-right\">Get started</a></p></div></div>");
$templateCache.put("easyToDoBusiness/liquor-notify-community/static/etb-liquor-community-intention.html","<div class=\"row\"><div class=\"col-lg-12\"><a class=\"btn btn-default\" ui-sref=\"etb.liquorNotifyCommunity\">Exit task</a><snsw-page-heading title=\"Task 1: Consult your community for your CIS\"></snsw-page-heading><h3>Introduction</h3><p>If you’re opening a restaurant or café, and want to serve alcohol without providing a meal, or if you’re intending to apply for extended trading hours, you’ll need to provide notice to your local neighbourhood. It’s your responsibility to talk to your community about any concerns people may have with your application for a liquor licence, and to ultimately prepare a community impact statement (CIS).</p><h3>What you’ll need</h3><p>Please ensure to provide the following information to your community:</p><ul><li>date of the notice</li><li>your name</li><li>type of liquor licence</li><li>proposed premises address</li><li>proposed trading hours</li><li>proposed activities and entertainment</li><li>maximum number of patrons, and</li><li>outline how to provide feedback to you regarding the proposal.</li></ul><p>When talking with your community and getting their feedback, it’s important to think about the following questions for your proposal:</p><ul><li>What are the main issues?</li><li>What are the negative responses?</li><li>What are the positive responses?</li><li>Which issues need further discussion?</li><li>How strongly does your community feel about these issues?</li><li>Do different stakeholders have similar issues?</li><li>Have you established any relationships with your local community that may help resolve any future issues?</li><li>Have you developed any ideas as a result of the consultation?</li><li>Do you need to make any changes to your proposal because of community feedback?</li></ul><h3>How to consult</h3><ol><li>Prepare an outline of your proposed application.</li><li>Identify your nearby community buildings, facilities and any other places to alert.</li><li>Visit your local police station.</li><li>Notify your local council.</li><li>Alert all neighbours within a 50 or 100 metre radius, depending on the type of licence.</li><li>Attach a site notice to the premises so it is easily seen by passers-by. This notice must remain until the Liquor & Gaming Authority NSW makes a decision about the application.</li></ol><h3>Things to keep in mind...</h3><ul><li>Consulting with your local community is an important opportunity for them to have their say.</li><li>Allow stakeholders 30 days (from the date of the notice) to give feedback on the proposal.</li><li>Gather feedback, identify key issues, and assess if further consultation is required.</li></ul><h3>Next steps</h3><p>After completing consultation, you’ll need to detail how you intend to handle the community issues, what feedback was received, and any changes you’ve made to your business plan. All of this is part of Task 2: <a ui-sref=\"etb.liquorNotifyCommunityImpact\">Complete Community Impact Statement</a>.</p><h3>Need Help?</h3><p>We can help you with this transaction. Feel free to call us on <a href=\"tel:137788\">13 77 88</a></p></div></div>");
$templateCache.put("easyToDoBusiness/liquor-rsa-police/static/etb-liquor-rsa-cert.html","<div class=\"row\"><div class=\"col-lg-12\"><a class=\"btn btn-default\" ui-sref=\"etb.liquorRSAPolice\">Exit task</a><snsw-page-heading title=\"Task 2: Apply for a Competency Card\"></snsw-page-heading><h3>Introduction</h3><p>After successfully completing your RSA training and receiving your interim certificate, you’ll need to apply for an RSA photo competency card.</p><h3>What you’ll need</h3><ol><li>your RSA Interim Certificate, issued by an approved NSW training provider</li><li>your 100 points of identity documents – see the back of your Interim Certificate for acceptable document types, and</li><li>if you’ve changed your name from what is shown on your identity documents, you\'ll need to provide a change of name certificate or marriage certificate (Australian or overseas with translation).</li></ol><h3>How to apply</h3><ol><li>Gather your RSA Interim Certificate and identity documents.</li><li>Visit a service centre and submit your application.</li></ol><h3>Things to keep in mind...</h3><ul><li>The photo for your card will be taken when you submit your application.</li><li>You’ll be fined if you, or any of your staff, work without a competency card, interim certificate, or valid paper certificate.</li><li>The cost of the competency card is included in the course fee you pay for RSA or RCG training.</li></ul><p>For more information, please visit the <a href=\"https://www.liquorandgaming.justice.nsw.gov.au/Pages/liquor/serving-alcohol-responsibly/responsible-service-of-alcohol/rsa-fines.aspx\" target=\"_blank\">Liquor &amp; Gaming NSW website</a></p><h3>Next steps</h3><p>Your photo competency card will be mailed to you within 3 weeks of submitting your application.</p><h3>Need Help?</h3><p>We can help you with this transaction. Feel free to call us on <a href=\"tel:137788\">13 77 88</a></p></div></div>");
$templateCache.put("easyToDoBusiness/liquor-rsa-police/static/etb-liquor-rsa-police-attend.html","<div class=\"row\"><div class=\"col-lg-12\"><a class=\"btn btn-default\" ui-sref=\"etb.liquorRSAPolice\">Exit task</a><snsw-page-heading title=\"Task 4: Visit the local police station\"></snsw-page-heading><h3>Introduction</h3><p>After completing your <a href=\"https://npcoapr.police.nsw.gov.au/aspx/dataentry/Introduction.aspx\">National Police Check online</a>, you need to attend your local police station to confirm your identity.</p><h3>What you\'ll need</h3><ul><li>printed confirmation of your completed online National Police Check, and</li><li>3 original proof of identity documents (not photocopies).</li></ul><h3>How to complete</h3><ol><li>Find your <a href=\"http://www.police.nsw.gov.au/\">local police station</a>.</li><li>Gather all the required documentation.</li><li>Visit the police station and submit your documents in person.</li><li>Pay the fee (if applicable).</li></ol><h3>Things to keep in mind...</h3><ul><li>Allow about 30 minutes for your application to be received before visiting the police station to complete your application.</li><li>If you’re unable to print the confirmation, write down the document ID number from the confirmation page.</li></ul><h3>Next steps</h3><p>Take your printed confirmation page and proof of identity documents and visit your local police station within 30 days.</p><h3>Need help?</h3><p>Contact us on 1800 123 45 or smallbiz@service.nsw.gov.au</p></div></div>");
$templateCache.put("easyToDoBusiness/liquor-rsa-police/static/etb-liquor-rsa-police-check.html","<div class=\"row\"><div class=\"col-lg-12\"><a class=\"btn btn-default\" ui-sref=\"etb.liquorRSAPolice\">Exit task</a><snsw-page-heading title=\"Task 3: Apply for a NSW National Police Certificate\"></snsw-page-heading><h3>Introduction</h3><p>Before you can hold a liquor licence in NSW, you’ll need to apply for a National Police Certificate to confirm you’re a fit and proper person to hold such a licence. Permanent residents of NSW can apply <a href=\"https://npcoapr.police.nsw.gov.au/aspx/dataentry/Introduction.aspx\" target=\"_blank\">online</a>.</p><p>If you’re not a permanent resident of NSW, you’ll need to complete the <a href=\"https://afpnationalpolicechecks.converga.com.au/\" target=\"_blank\">Australian Federal Police online application</a>.</p><h3>What you’ll need</h3><ul><li>your email address</li><li>a valid credit or debit card</li><li>your personal details, including any previous name such as maiden name</li><li>3 original proof of identity documents (not photocopies), as listed on the form, and</li><li>signed consent to conduct the police check.</li></ul><h3>How to apply</h3><ol><li>Complete <a href=\"https://npcoapr.police.nsw.gov.au/aspx/dataentry/Introduction.aspx\" target=\"_blank\">the application</a>.</li><li>Read and accept the consent.</li><li>Enter your payment details and submit your application, or pay the fee later at the police station.</li><li>Print the confirmation page.</li></ol><h3>Things to keep in mind...</h3><ol><li>Always double check your information, as any false, misleading or omitted information is considered an offence.</li><li>You’ll be asked to certify that the personal information you have provided on the completed application form is true.</li><li>Allow 30 minutes after submitting your online application before visiting a police station with your identity documents.</li></ol><h3>Next steps</h3><p>Within 30 days, visit a Police Station to have your 3 forms of identification verified.</p><h3>Need Help?</h3><p>We can help you with this transaction. Feel free to call us on <a href=\"tel:137788\">13 77 88</a></p></div></div>");
$templateCache.put("easyToDoBusiness/liquor-rsa-police/static/etb-liquor-rsa-police-finalise.html","<div class=\"row\"><div class=\"col-lg-12\"><a class=\"btn btn-default\" ui-sref=\"etb.liquorRSAPolice\">Exit task</a><snsw-page-heading title=\"Finalise application\"></snsw-page-heading><h3>What you have completed</h3><p>As part of obtaining your RSA Certificate &amp; National Police Certificate you should have completed the following:</p><ol><li>Passed your RSA Training</li><li>Collected your RSA Certificate</li><li>Submitted National Police Check</li><li>Collected National Police Certificate from the Police Station</li></ol><p>You should now have your RSA Certificate and National Police Certificate in your possession</p><h3>What Next</h3><p>Your Small Business Enablement Representative will review your application and attachments and will contact you &lt;within ?? days&gt; for any outstanding requirements, and to outline your next steps.</p><h3>Need Help?</h3><p>Call your Small Business Enablement Team on 1800 123 456</p></div></div>");
$templateCache.put("easyToDoBusiness/liquor-rsa-police/static/etb-liquor-rsa-training.html","<div class=\"row\"><div class=\"col-lg-12\"><a class=\"btn btn-default\" ui-sref=\"etb.liquorRSAPolice\">Exit task</a><snsw-page-heading title=\"Task 1: Undertake Responsible Service of Alcohol (RSA) training\"></snsw-page-heading><h3>Introduction</h3><p>To be able to serve alcohol, you as the licensee, and any staff who’ll be serving alcohol, will need to complete Responsible Service of Alcohol (RSA) training. RSA training covers:</p><ul><li>the impact of alcohol</li><li>preventing intoxication and underage drinking, and</li><li>alcohol-related violence and crime.</li></ul><h3>What you’ll need</h3><p>A <a href=\"https://www.liquorandgaming.justice.nsw.gov.au/Pages/liquor/serving-alcohol-responsibly/rsa-training/find-an-rsa-course.aspx#RSAonlinecourse\" target=\"_blank\">Registered Training Organisation (RTO)</a> to provide your RSA training, either online or in a classroom.</p><h3>How to complete</h3><ol><li>Book in for your course.</li><li>Successfully complete the training.</li></ol><h3>Things to keep in mind...</h3><ul><li>The RTO will give you an interim certificate on completion of the course.</li><li>The interim certificate is valid for 90 days, and allows you to work immediately.</li><li>It’ll take up to 3 weeks for you to receive your photo competency card. You’ll need the photo competency card in order to apply for the liquor licence.</li></ul><h3>Next steps</h3><p>Please refer to <a ui-sref=\"etb.liquorRSAPoliceRSACert\">Task 2: Apply for a Competency Card</a> after your RSA training is complete.</p><h3>Need Help?</h3><p>We can help you with this transaction. Feel free to call us on <a href=\"tel:137788\">13 77 88</a></p></div></div>");
$templateCache.put("easyToDoBusiness/liquor-small-bars/attach/etb-small-bars-attach.html","<etb-file-upload return-state=\"\'etb.liquorSmallBars\'\" transaction=\"transaction\"><a class=\"btn btn-default\" ui-sref=\"etb.liquorSmallBars\">Exit task</a><snsw-page-heading title=\"Task 3: Upload Supporting Documents\"></snsw-page-heading><h3>Introduction</h3><p>You’ll need to upload several supporting documents as part of your small bar liquor licence application.</p><h3>What you’ll need</h3><ul><li>a completed <a ui-sref=\"etb.liquorSmallBarsPreform\">small bar liquor licence application</a></li><li>a completed <a ui-sref=\"etb.liquorSmallBarsNotice\">police notice application.</a></li><li>development consent, and evidence the NSW Police Force and the Secretary of the NSW Department of Justice were notified within 2 days of your development application</li><li>your Community Impact Statement (CIS) if you didn’t notify the NSW Police Force and the Secretary of the NSW Department of Justice within 2 days of your development application</li><li>a floor plan showing the boundaries proposed for your small bar</li><li>your National Police Certificate (issued within the last 3 months)</li><li>a copy of the 3 identity documents presented when you applied for your National Police Certificate</li><li>a copy of your RSA certificate or competency card.</li></ul><h3>How to upload</h3><ol><li>Scan your supporting documents.</li><li>Save your supporting documents using the following conventions:<ul><li>File type: PDF or ZIP format</li><li>File name format: Document Type - Property Address (for example, PDF - 30 Darcy Street Parramatta)</li><li>File size: must be less than 2MB.</li></ul></li><li>Upload your supporting documents.</li><li>We\'ll contact you within 2 business days of receiving your documents.</li></ol><h3>Things to keep in mind...</h3><ul><li>You can only upload documents once. Any previously uploaded documents will be replaced with the newly uploaded documents.</li><li>You can attach multiple documents at a time.</li></ul><h3>Next steps</h3><p>We\'ll contact you within 2 days of receiving your supporting documents to <a ui-sref=\"etb.liquorSmallBarsFinalise\">finalise your application</a>.</p><h3>Need help?</h3><p>We can help you with this transaction. Feel free to call us on <a href=\"tel:137788\">13 77 88</a></p></etb-file-upload>");
$templateCache.put("easyToDoBusiness/liquor-small-bars/form/etb-small-bars-preform.html","<div class=\"row\"><div class=\"col-lg-12\"><a class=\"btn btn-default\" ui-sref=\"etb.liquorSmallBars\">Exit task</a><snsw-page-heading title=\"Task 1: Apply for a Small Bar Liquor Licence\"></snsw-page-heading><h3>Introduction</h3><p>If you want to operate a small bar in NSW, you\'ll need to apply for a small bar liquor licence. This licence lets you serve alcohol at a bar with a patron capacity limited to 60 people.</p><h3>What you\'ll need</h3><ul><li>your small bar licence application form</li><li>your <a ui-sref=\"etb.premiseDaPreform\">Development Approval number</a></li><li>details of your <a ui-sref=\"etb.liquorRSAPoliceRSAProvider\">Responsible Service of Alcohol qualifications</a></li><li>your <a ui-sref=\"etb.liquorRSAPoliceCheck\">NSW Police Certificate</a> (issued within the last 3 months)</li><li>your proposed licence details</li><li>your liquor trading hours</li><li>a floor plan showing the boundaries proposed for your small bar</li><li>evidence the NSW Police Force and the Secretary of the NSW Department of Justice were notified within 2 days of your development application</li><li>if you didn’t notify the NSW Police Force and the Secretary of the NSW Department of Justice within 2 days of your development application, you’ll need to attach your community impact statement (CIS).</li></ul><h3>How to apply</h3><ol><li>Complete and submit your application to us for review.</li><li>Consult with us and add any additional items if necessary.</li><li>Receive the completed application via email for your review.</li><li>Print and sign the application.</li><li>Scan and send the application to us via email.</li></ol><p>We\'ll contact you after receiving your signed application.</p><h3>Things to keep in mind….</h3><p>You’ll need to contact us if:</p><ul><li>you want to apply for Extended Trading Authorisation (ETA), or</li><li>you didn’t notify the Secretary of the NSW Department of Justice and the NSW Police Force within 2 days of submitting your Development Approval.</li></ul><h3>Next step</h3><p>After you’ve completed your small bar licence application, we\'ll contact you with information on <a ui-sref=\"etb.liquorSmallBarsNotice\">Completing your Police Notices</a>.</p><h3>Need Help?</h3><p>We can help you with this transaction. Feel free to call us on <a href=\"tel:137788\">13 77 88</a></p><p><a ui-sref=\"etb.form({activityName:\'liquorSmallBarLicenceFormService\', returnState: \'etb.liquorSmallBars\'})\" class=\"btn btn-lg btn-primary pull-right\">Next</a></p></div></div>");
$templateCache.put("easyToDoBusiness/liquor-small-bars/static/etb-small-bars-finalise.html","<div class=\"row\"><div class=\"col-lg-12\"><a class=\"btn btn-default\" ui-sref=\"etb.liquorSmallBars\">Exit task</a><snsw-page-heading title=\"Task 4: Finalise a small bar liquor licence application\"></snsw-page-heading><h3>Introduction</h3><p>We\'ll contact you to finalise your small bar liquor licence application.</p><h3>What you’ll need</h3><p>Before you finalise your application with us, you’ll need to have:</p><ul><li>completed your <a ui-sref=\"etb.liquorSmallBarsPreform\">small bar liquor licence application</a></li><li>completed your <a ui-sref=\"etb.liquorSmallBarsNotice\">police notice</a></li><li><a ui-sref=\"etb.liquorSmallBarsAttach\">uploaded your supporting documents</a> for your small bar liquor licence</li></ul><h3>How to finalise</h3><ol><li>We\'ll review all your documentation, including your signed form and required supporting documents, and will contact you within 2 business days to finalise your small bar liquor licence application.</li><li>We\'ll submit your application and supporting documents to the NSW Department of Justice.</li><li>We\'ll contact you about your small bar liquor licence application payment.</li><li>The NSW Department of Justice will post your application on the electronic <a href=\"http://www.liquorandgaming.justice.nsw.gov.au/\">Liquor Applications Noticeboard</a>. Your application will remain open for public submissions for 30 days.</li><li>After submissions are closed, the NSW Department of Justice will review and process your application.</li><li>Once your application has been approved, you’ll receive your small bar liquor licence via post or email.</li></ol><h3>Things to keep in mind...</h3><p>In addition to your small bar liquor licence application fee, you’ll also be required to pay ongoing yearly licence fees.<br>For more information, please visit the <a href=\"https://www.liquorandgaming.justice.nsw.gov.au/\">NSW Department of Justice website</a></p><h3>Need help?</h3><p>We can help you with this transaction. Feel free to call us on <a href=\"tel:137788\">13 77 88</a></p></div></div>");
$templateCache.put("easyToDoBusiness/liquor-small-bars/static/etb-small-bars-notice.html","<div class=\"row\"><div class=\"col-lg-12\"><a class=\"btn btn-default\" ui-sref=\"etb.liquorSmallBars\">Exit task</a><snsw-page-heading title=\"Task 2: Complete a local police notice\"></snsw-page-heading><h3>Introduction</h3><p>As part of your small bar liquor licence application, you need to notify the police station nearest your business premises of your application.</p><h3>What you\'ll need</h3><ul><li>your police notice application form from us</li><li>your completed and signed <a ui-sref=\"etb.liquorSmallBarsPreform\">small bar liquor licence application</a></li><li>development consent, and evidence the NSW Police Force and the Secretary of the NSW Department of Justice were notified within 2 days of your development application</li><li>a floor plan showing the boundaries proposed for your small bar</li><li>your National Police Certificate (issued within the last 3 months)</li><li>a copy of the 3 identity documents presented when you applied for your National Police Certificate, and</li><li>a copy of your RSA certificate or competency card</li></ul><h3>How to complete</h3><ol><li>Download, print and complete the police notice application we emailed to you.</li><li>Gather together your:<ul><li>completed police notice application</li><li>supporting documents</li><li>completed and signed small bar liquor licence application, and</li></ul></li><li>Visit the police station nearest your premises to sign your police notice application.</li></ol><h3>Things to keep in mind...</h3><p>You’ll need to contact us if:</p><ul><li>you want to apply for Extended Trading Authorisation (ETA), or</li><li>you didn’t notify the Secretary of the NSW Department of Justice and the NSW Police Force within 2 days of submitting your Development Approval.</li></ul><h3>Next steps</h3><p>After completing your police notice application, you’ll need to <a ui-sref=\"etb.liquorSmallBarsAttach\">upload all supporting documents</a> for your small bar licence application.</p><h3>Need help?</h3><p>We can help you with this transaction. Feel free to call us on <a href=\"tel:137788\">13 77 88</a></p></div></div>");
$templateCache.put("easyToDoBusiness/premise-construction/form/etb-premise-preform.html","<div class=\"row\"><div class=\"col-lg-12\"><a class=\"btn btn-default\" ui-sref=\"etb.premiseConstruction\">Exit task</a><snsw-page-heading title=\"Task 1: Apply for a construction certificate\"></snsw-page-heading><h3>Introduction</h3><p>A construction certificate is required if you’re undertaking any building or structural work on your premises. This certificate certifies that the detailed construction plans and specifications for the development are consistent with the development approval, and comply with the Building Code of Australia. The certificate is required prior to commencing any construction work.</p><p>If you’ve chosen an independent PCA rather than your local council, they’ll advise you on the steps you need to take.</p><h3>What you’ll need</h3><ul><li>development approval</li><li>a Principal Certifying Authority (PCA), and</li><li>documents relevant to your construction work such as:<ul><li>site plan</li><li>floor plan</li><li>elevation plan</li><li>section plan</li><li>building specifications</li><li>landscaping plan</li><li>erosion and sediment control</li><li>drainage/stormwater plan, and</li><li>structural details.</li></ul></li></ul><h3>How to apply</h3><ol><li>Complete and submit the online application to us for review.</li><li>Consult with us and add any additional items if necessary.</li><li>Receive the completed forms via email for your final review.</li><li>Print and sign all forms.</li></ol><h3>Things to keep in mind….</h3><p>Keep all your documentation in a safe place:</p><ul><li>file all hard copies, and</li><li>scan and save digital copies onto your desktop<ul><li>naming conventions required by council are Document Type – Property Address (for example, Construction Certificate – 123 Main St).</li></ul></li></ul><h3>Next steps</h3><p>We\'ll review your application to ensure you’ve supplied all the necessary data, and then send you:</p><ul><li>all the completed forms for your review and signature, and</li><li>the information on <a ui-sref=\"etb.premiseConstructionOwnersConsent\">Get owners construction consent</a> to obtain the owner’s consent for construction.</li></ul><h3>Need help?</h3><p>We can help you with this transaction. Feel free to call us on <a href=\"tel:137788\">13 77 88</a></p><p><a ui-sref=\"etb.form({activityName:\'daConstructionFormService\', returnState: \'etb.premiseConstruction\'})\" class=\"btn btn-lg btn-primary pull-right\">Next</a></p></div></div>");
$templateCache.put("easyToDoBusiness/premise-construction/static/etb-premise-construction-finalise.html","<div class=\"row\"><div class=\"col-lg-12\"><a class=\"btn btn-default\" ui-sref=\"etb.premiseConstruction\">Exit task</a><snsw-page-heading title=\"Task 5: Finalise your Notice of Commencement and other construction approvals\"></snsw-page-heading><h3>Introduction</h3><p>We\'ll contact you to finalise your Notice of Commencement and additional construction approvals.</p><h3>What you’ll need</h3><ul><li>your completed and signed <a ui-sref=\"etb.premiseConstructionPreform\">construction certificate application</a> including signed owner’s consent</li><li>your completed and signed <a ui-sref=\"etb.premiseConstructionNotice\">Notice of Commencement application and other construction approvals</a>, and</li><li>hard copies of all the required documents (please refer to our email).</li></ul><h3>How to finalise</h3><ol><li>Alert us when you have all the documents and forms for your Notice of Commencement.</li><li>We\'ll run through a checklist with you to ensure you’ve completed all relevant tasks, and provided all the required supporting documentation.</li><li>We\'ll submit your documentation, liaise with the local council, and guide you on how to finalise your application (that is, additional required documentation and payment).</li></ol><h3>Things to keep in mind...</h3><ul><li>You’ll receive your Notice of Commencement approval and any other approvals approximately 6 to 8 weeks from your submission date, provided there are no additional documents or fees to be processed from this date.</li><li>Ensure that your construction certificate and Notice of Commencement are visible on the construction site.</li><li>Give the Council or your independent PCA a minimum of 2 days’ notification before building works start.</li></ul><h3>Need Help?</h3><p>We can help you with this transaction. Feel free to call us on <a href=\"tel:137788\">13 77 88</a></p></div></div>");
$templateCache.put("easyToDoBusiness/premise-construction/static/etb-premise-construction-notice.html","<div class=\"row\"><div class=\"col-lg-12\"><a class=\"btn btn-default\" ui-sref=\"etb.premiseConstruction\">Exit task</a><snsw-page-heading title=\"Task 3: Apply for a Notice of Commencement and other construction approvals\"></snsw-page-heading><h3>Introduction</h3><p>Before starting any construction work, you’ll need to apply for certain construction licences and approvals, including:</p><ul><li>Notice of Commencement of Work – this notifies the council of your intention to start building works.</li><li>Hoarding – if you intend putting up temporary fencing around the construction site.</li><li>Road/footpath occupancy – if your building works will affect or occupy public spaces such as roads, footpaths, bus lanes, taxi zones, access to properties, or traffic signals.</li></ul><h3>What you’ll need</h3><p>Details and documentation relating to the:</p><ul><li>type of work</li><li>location of work</li><li>site elevation plans</li><li>structural engineer’s details</li><li>dilapidation report (if applicable)</li><li>expected duration of work, and</li><li>public liability insurance policy.</li></ul><h3>How to complete</h3><ol><li>Complete and submit the online application to us for review.</li><li>Consult with us and add any additional items if necessary.</li><li>Receive the completed forms via email for your final review.</li><li>Print and sign all forms.</li></ol><h3>Things to keep in mind...</h3><p>Keep all your documentation in a safe place:</p><ul><li>file all hard copies, and</li><li>scan and save digital copies onto your desktop<ul><li>naming conventions required by council are Document Type – Property Address (for example, Notice of Commencement – 123 Main St).</li></ul></li></ul><h3>Next steps</h3><p>We\'ll review your application to ensure you’ve supplied all the necessary data, and then send you:</p><ul><li>all the completed forms for your review and signature</li><li>the information on how to <a ui-sref=\"etb.premiseConstructionWaste\">Apply for a waste container permit</a> (if applicable), and</li><li>the information to <a ui-sref=\"etb.premiseConstructionFinalise\">Finalise your Notice of Commencement</a></li></ul><h3>Need Help?</h3><p>We can help you with this transaction. Feel free to call us on <a href=\"tel:137788\">13 77 88</a></p><p><a ui-sref=\"etb.form({activityName:\'daConstuctionNoticeFormService\', returnState: \'etb.premiseConstruction\'})\" class=\"btn btn-lg btn-primary pull-right\">Next</a></p></div></div>");
$templateCache.put("easyToDoBusiness/premise-construction/static/etb-premise-construction-owners-consent.html","<div class=\"row\"><div class=\"col-lg-12\"><a class=\"btn btn-default\" ui-sref=\"etb.premiseConstruction\">Exit task</a><snsw-page-heading title=\"Task 2: Get owner’s construction consent\"></snsw-page-heading><h3>Introduction</h3><p>To complete your construction certificate application, you’ll need to confirm that the owner of the premises approves of any construction work that may occur. Once we\'ve sent you all the relevant forms for final review, you’ll need to have the premises owner/s complete the Owner’s Consent section of the construction certificate form.</p><h3>What you’ll need</h3><p>Printed copies of the construction certificate form that we\'ll email you, once we’ve reviewed your <a ui-sref=\"etb.premiseConstructionPreform\">construction certificate application</a>.</p><h3>How to complete</h3><ol><li>Identify the relevant parties who’ll need to give the consent related to your construction work.</li><li>Download and print the construction certificate form we sent you via email. Be sure to print enough copies for the third parties.</li><li>Meet with the relevant parties to review the construction certificate application.</li><li>Ensure the relevant parties complete and sign the forms.</li><li>Scan all the signed forms and any additional documents.</li><li>We\'ll do one final review of the forms and attachments, and send the details to the Certifying group of your local council.</li><li>We\'ll liaise with the Certifying group and guide you on how to finalise your application (that is, about any additional required documentation and payment).</li><li>Receive your construction certificate.</li></ol><h3>Things to keep in mind...</h3><p>Keep all your documentation in a safe place:</p><ul><li>file all hard copies, and</li><li>scan and save digital copies onto your desktop<ul><li>naming conventions required by council are Document Type – Property Address (for example, Construction Certificate – 123 Main St).</li></ul></li></ul><h3>Next steps</h3><p>Once you’ve completed this task, you’ll then need to:</p><ul><li>notify your builder of your appointed Principle Certifying Authority (PCA), and ensure they’re informed of the critical stage inspections the PCA needs to undertake</li><li>make sure your PCA has carried out a pre-commencement inspection of the site</li><li><a ui-sref=\"etb.premiseConstructionNotice\">Apply for a Notice of Commencement and other construction approvals</a></li><li><a ui-sref=\"etb.premiseConstructionWaste\">Apply for construction waste removal</a> (if applicable).</li></ul><h3>Need Help?</h3><p>We can help you with this transaction. Feel free to call us on <a href=\"tel:137788\">13 77 88</a></p></div></div>");
$templateCache.put("easyToDoBusiness/premise-construction/static/etb-premise-construction-waste.html","<div class=\"row\"><div class=\"col-lg-12\"><a class=\"btn btn-default\" ui-sref=\"etb.premiseConstruction\">Exit task</a><snsw-page-heading title=\"Task 4: Apply for a waste container permit\"></snsw-page-heading><h3>Introduction</h3><p>If you’ll be undertaking building work on your premises and plan to use a waste container for construction waste removal, you’ll need a permit from Parramatta City Council. You only need a permit if the waste container will be located on a public street or footpath.</p><h3>What you’ll need</h3><ul><li>the application form we emailed to you</li><li>supplier/contractor details for your waste container</li><li>size of the container</li><li>expected location and area it will take up</li><li>how long it will be required to stay in the location, and</li><li>insurance details provided by the supplier of the container.</li></ul><h3>How to apply</h3><ol><li>Print, complete and sign the form.</li><li>Scan all signed forms and additional attachments.</li><li>Email all forms and attachments to us.</li><li>We\'ll submit your documentation and liaise with the local council if there is any additional documentation or payment required.</li></ol><h3>Things to keep in mind...</h3><ul><li>Council will provide approval approximately 2 weeks from your submission date, provided there are no additional documents or fees to be processed from this date.</li><li>The approval/permit will be emailed to you, and must be kept on-site at all times.</li><li>You must make sure you and your building contractors adhere to the permit conditions as outlined in section 7 of the form.</li></ul><h3>Nex steps</h3><p>We\'ll review your application to ensure you’ve supplied all the necessary data and send you the information to <a ui-sref=\"etb.premiseConstructionFinalise\">Finalise your Notice of Commencement</a>.</p><h3>Need Help?</h3><p>We can help you with this transaction. Feel free to call us on <a href=\"tel:137788\">13 77 88</a></p></div></div>");
$templateCache.put("easyToDoBusiness/premise-da/form/etb-premise-preform.html","<div class=\"row\"><div class=\"col-lg-12\"><a class=\"btn btn-default\" ui-sref=\"etb.premiseDa\">Exit task</a><snsw-page-heading title=\"Task 1: Prepare your Development Application\"></snsw-page-heading><h3>Introduction</h3><p>You must complete a Development Application (DA) if you plan to make any changes to the premises of your new business. Part of your DA may include approval for:</p><ul><li>signage and awnings, and/or</li><li>footpath dining.</li></ul><h3>What you\'ll need</h3><ul><li>the existing use of the premises (if applicable)</li><li>proposed operating hours and staff numbers</li><li>existing and proposed car spaces and loading facilities</li><li>cost of the proposed works</li><li>proposed awnings or signage (if applicable)</li><li>proposed footpath dining details (if applicable), and</li><li>liability insurance up to $20 million for footpath dining (if applicable).</li></ul><p>Check the email you’ve received from us for a further list of the documents you may need.</p><h3>How to prepare</h3><ol><li>Complete and submit your application to us for review.</li><li>Consult with us and add any additional items if necessary.</li><li>Receive your completed forms for final review.</li><li>Print and sign all the forms.</li><li>Receive a document guide email from us to ensure you have all the necessary documentation to support your DA.</li></ol><h3>Next steps</h3><p>We\'ll review your application to ensure you’ve supplied all the necessary data, and then:</p><ul><li>send you the information on how to <a ui-sref=\"etb.premiseDaOwnersConsent\">Get owner’s DA consent</a> and <a ui-sref=\"etb.premiseDaInputBuilder\">Get builder and engineer DA input</a> (if applicable), or</li><li>contact you to <a ui-sref=\"etb.premiseDaFinalise\">Finalise your DA</a>.</li></ul><h3>Need help?</h3><p>We can help you with this transaction. Feel free to call us on <a href=\"tel:137788\">13 77 88</a></p><p><a ui-sref=\"etb.form({activityName:\'daFormService\', returnState: \'etb.premiseDa\'})\" class=\"btn btn-lg btn-primary pull-right\">Next</a></p></div></div>");
$templateCache.put("easyToDoBusiness/premise-da/static/etb-premise-da-finalise.html","<div class=\"row\"><div class=\"col-lg-12\"><a class=\"btn btn-default\" ui-sref=\"etb.premiseDa\">Exit task</a><snsw-page-heading title=\"Task 4: Finalise your Development Application\"></snsw-page-heading><h3>Introduction</h3><p>We\'ll contact you to finalise your Development Application (DA), and outline what you need for your in-person submission with Parramatta City Council.</p><h3>What you’ll need</h3><ul><li>your completed and signed <a ui-sref=\"etb.premiseDaPreform\">Development Application</a> including signatures and input from any relevant third parties</li><li>to have reviewed the cost estimates you provided in your DA application, as incorrect information could incur a higher fee from council</li><li>hard copies of all the required documents (refer to our email), and</li><li>a CD-ROM containing all the required digital documents.</li></ul><h3>How to finalise</h3><ol><li>Alert us when you’re ready to submit your DA.</li><li>We\'ll run through a checklist with you to ensure you have all the required documentation. If you’re planning to serve alcohol, we\'ll send you the Notice of DA form. This must be lodged with the NSW Department of Justice and your local police station within 2 business days of your submitting your DA to Parramatta City Council.</li><li>Visit Parramatta City Council service centre at 126 Church Street, Parramatta to lodge and pay for your DA.</li><li>You’ll receive a receipt of fees and a DA reference number. This reference number can be used to track the status of your DA.</li><li>The council will review your DA and request additional items or payment if necessary.</li><li>You may need to pay additional fees for community advertising of your DA. These fees are payable over the phone, or in person at Parramatta City Council.</li><li>If your application is successful, you’ll be provided with development approval. Any conditions relating to that approval will need to be met.</li><li>Alert us once you’ve received your approval, and we\'ll support you in your next steps.</li></ol><h3>Things to keep in mind…</h3><ul><li>Council will provide development approval approximately 3 months after your submission date, provided there are no additional documents or fees to be processed from this date.</li><li>Parramatta City Council may apply certain conditions to your development approval. These must be met before you can open your business, so please review your approval carefully.</li></ul><h3>Next steps</h3><p>After receiving development approval, you’ll need to <a ui-sref=\"etb.premiseConstruction\">nominate a Principal Certifying Authority.</a></p><h3>Need help?</h3><p>We can help you with this transaction. Feel free to call us on <a href=\"tel:137788\">13 77 88</a></p></div></div>");
$templateCache.put("easyToDoBusiness/premise-da/static/etb-premise-input-builder.html","<div class=\"row\"><div class=\"col-lg-12\"><a class=\"btn btn-default\" ui-sref=\"etb.premiseDa\">Exit task</a><snsw-page-heading title=\"Task 3: Get builder and engineer input\"></snsw-page-heading><h3>Introduction</h3><p>To finalise your Development Application (DA) before submitting to council, you may need input from key third parties, such as your architect, engineer or builder.</p><h3>What you’ll need</h3><p>Printed copies of the DA forms that we\'ll email you, once we’ve reviewed your <a ui-sref=\"etb.premiseDaPreform\">Prepare your Development Application</a> submission.</p><h3>How to complete</h3><ol><li>Identify the relevant parties who’ll need to provide additional information for your DA.</li><li>Download and print the DA forms we sent you via email. Be sure to print enough copies for all third parties.</li><li>Meet with the relevant parties to review your DA.</li><li>Gather any additional information (such as stormwater design, site and floor plans).</li><li>Ensure the relevant parties complete and sign the forms.</li><li>Scan all the signed forms and additional documents.</li></ol><h3>Things to keep in mind….</h3><p>Keep all your documentation in a safe place:</p><ul><li>file all hard copies, and</li><li>scan and save digital copies onto your desktop<ul><li>naming conventions required by council are Document Type – Property Address (for example, DA – 123 Main St).</li></ul></li></ul><h3>Next steps</h3><p>As part of <a ui-sref=\"etb.premiseDaFinalise\">Finalising your DA</a>, we\'ll run through a checklist with you to ensure you have everything you need for your DA submission to Parramatta City Council.</p><h3>Need Help?</h3><p>We can help you with this transaction. Feel free to call us on <a href=\"tel:137788\">13 77 88</a></p></div></div>");
$templateCache.put("easyToDoBusiness/premise-da/static/etb-premise-owners-consent.html","<div class=\"row\"><div class=\"col-lg-12\"><a class=\"btn btn-default\" ui-sref=\"etb.premiseDa\">Exit task</a><snsw-page-heading title=\"Task 2: Get owner\'s DA consent\"></snsw-page-heading><h3>Introduction</h3><p>To complete your Development Application (DA), you’ll need to confirm that the owner of the premises approves any construction work that may occur. Once we\'ve sent you the relevant documentation for final review, you’ll need to have the owner of the premises complete the Owner’s Consent section of the DA form.</p><h3>What you’ll need</h3><p>Printed copies of the DA form that we\'ll email you once we\'ve reviewed your <a ui-sref=\"etb.premiseDaPreform\">Prepare your Development Application</a> submission.</p><h3>How to complete</h3><ol><li>Identify the relevant parties who’ll need to give consent related to your DA.</li><li>Download and print the DA form we sent you via email. Be sure to print enough copies for all third parties.</li><li>Meet with the relevant parties to review the DA.</li><li>Ensure the relevant parties review all the details of the DA, and complete and sign the forms.</li><li>Scan all the signed forms and additional documents.</li></ol><h3>Things to keep in mind…</h3><p>Keep all your documentation in a safe place:</p><ul><li>file all hard copies, and</li><li>scan and save digital copies onto your desktop<ul><li>naming conventions required by council are Document Type – Property Address (for example, DA – 123 Main St).</li></ul></li></ul><h3>Next steps</h3><p>As part of <a ui-sref=\"etb.premiseDaFinalise\">Finalising your DA</a>, we\'ll run through a checklist with you to ensure you have everything you need for your DA submission to Parramatta City Council.</p><h3>Need help?</h3><p>We can help you with this transaction. Feel free to call us on <a href=\"tel:137788\">13 77 88</a></p></div></div>");
$templateCache.put("easyToDoBusiness/premise-inspection/attach/etb-premise-inspection-attach.html","<etb-file-upload return-state=\"\'etb.premiseInspection\'\" transaction=\"transaction\"><a class=\"btn btn-default\" ui-sref=\"etb.premiseInspection\">Exit task</a><snsw-page-heading title=\"Task 3: Attach Supporting Documents\"></snsw-page-heading><h3>Introduction</h3><p>To complete this activity, you will need to upload all your certification documents that you have completed so far.</p><h3>Documents to upload</h3><p>To provide your local council with the necessary documents before inspection, please upload the following:</p><ul><li>Final Fire Safety Statement</li><li>Smoke Detection and Alarm System Certificate</li><li>Waste water and Waste Management details</li></ul><h3>Things to keep in mind...</h3><ul><li>A copy of the Final Fire Safety Statement together with a copy of the current fire safety schedule must be:<ul><li>Forwarded to the Council and the Commissioner of the NSW Fire Brigades (Private Locked Bag 12, Greenacre NSW 2190)</li><li>Prominently displayed in the building.</li></ul></li></ul><p>All file attachments <span style=\"text-decoration: underline;\">must</span> meet these requirements:</p><ul><li>Format: PDF or Zip format</li><li>File Name Format: “Document Type - Property Address”. Examples below:<ul><li>Final Fire Safety Statement – 30 Darcy Street Parramatta.pdf</li><li>Application Form – 30 Darcy Street Parramatta.pdf</li></ul></li><li>File size: &lt;2MB<ul><li>Call your Small Business Enablement Team on 1800 123 456 if your file size exceeds 2MB</li></ul></li></ul><h3>Need Help?</h3><p>Call your Small Business Enablement Team on 1800 123 456</p></etb-file-upload>");
$templateCache.put("easyToDoBusiness/premise-inspection/static/etb-premise-fire-safety-smoke.html","<div class=\"row\"><div class=\"col-lg-12\"><a class=\"btn btn-default\" ui-sref=\"etb.premiseInspection\">Exit task</a><snsw-page-heading title=\"Task 1: Complete fire safety and smoke detection checks\"></snsw-page-heading><h3>Introduction</h3><p>To receive your Occupation Certificate, you’ll need to satisfactorily complete fire safety and smoke detection checks. The completing and submitting the Final Fire Safety Statement, and Smoke Detection and Alarm System Certification forms, will ensure your building is safe and secure for your business to occupy.</p><h3>What you’ll need</h3><ol><li>Alert us that you’re ready to complete your fire safety and smoke detection requirements.</li><li>We\'ll send you the forms via email:<ul><li>Final Fire Safety Statement</li><li>Smoke Detection and Alarm System Certification</li></ul></li><li>Print and complete the forms.</li><li>Complete a fire safety inspection with a qualified fire safety inspector</li><li>Test the smoke detection and alarm systems with a qualified installer</li><li>Have the owner/s sign the forms where applicable.</li><li>Have qualified third parties complete the forms where applicable.</li><li>Scan and email all signed forms and any additional attachments.</li><li>We\'ll collect the forms and pass them to your local council and the NSW fire commissioner.</li><li>The local council will contact you to conduct a final building inspection – <a ui-sref=\"etb.premiseInspectionPostConstruction\">Prepare for construction inspection</a>. If they’re also your Principal Certifying Authority, they’ll provide you with your Occupation Certificate upon approval.</li></ol><h3>Things to keep in mind...</h3><p>The <i>Environmental Planning &amp; Assessment Regulation 2000</i> outlines that:</p><ul><li>essential fire safety measures need to be maintained, and</li><li>on the anniversary of the date of the Final Fire Safety Certificate, an Annual Fire Safety Statement must be prepared by the owner or agent, and displayed on the premises.</li></ul><h3>Need Help?</h3><p>We can help you with this transaction. Feel free to call us on <a href=\"tel:137788\">13 77 88</a></p></div></div>");
$templateCache.put("easyToDoBusiness/premise-inspection/static/etb-premise-post-construction.html","<div class=\"row\"><div class=\"col-lg-12\"><a class=\"btn btn-default\" ui-sref=\"etb.premiseInspection\">Exit task</a><snsw-page-heading title=\"Task 2: Prepare for your post-construction inspection\"></snsw-page-heading><h3>Introduction</h3><p>Once you’ve completed construction and obtained all necessary compliance permits, you’ll need an occupation certificate. This certificate verifies that the Principal Certifying Authority (the council or a private certifier) is satisfied that the building is suitable to occupy, and satisfies the relevant requirements of the Building Code of Australia (BCA).<br>The occupation certificate authorises you to occupy and/or use a new building, or commence a new use of an existing building.</p><p>To obtain this certificate, a site inspection is required, so please ensure that you’ve met all outstanding DA conditions before requesting an inspection.</p><h3>What you’ll need</h3><p>Copies of your:</p><ul><li>development approval</li><li>construction certificate</li><li>waste water services</li><li>commercial waste</li><li>fire safety permit</li><li>smoke detection permit, and</li><li>final fire safety statement.</li></ul><p>For new constructions, you’ll also need your:</p><ul><li>waterproofing certificate, and</li><li>glazing certificate.</li></ul><h3>How to complete</h3><ol><li>The local council will contact you to conduct a final building inspection.</li><li>If your PCA is not the local council, that organisation will also need to complete an inspection before you open, to ensure the premises meet the health and food safety regulations.</li></ol><h3>Things to keep in mind...</h3><ul><li>The BCA is a code that sets the standards for the design and construction of various classes of buildings to maintain and protect public health, safety and amenity.</li><li>Alert us when you’ve received your occupation certificate, and we’ll support you in any additional steps before you open your new business.</li></ul><h3>Need Help?</h3><p>We can help you with this transaction. Feel free to call us on <a href=\"tel:137788\">13 77 88</a></p></div></div>");
$templateCache.put("easyToDoBusiness/premise-inspection/static/etb-premise-summary.html","<div class=\"row\"><div class=\"col-lg-12\"><a class=\"btn btn-default\" ui-sref=\"etb.premiseInspection\">Exit task</a><snsw-page-heading title=\"Summary Page\"></snsw-page-heading><h3>What you have completed</h3><p>As part of the complete post-construction inspection, you should have completed the following:</p><ol><li>Submitted your Fire safety &amp; Smoke detection application</li><li>Completed your post construction inspection with your PCA (Private or council). If council was your elected PCA, you may have completed your health inspection also (prior to opening).</li><li>Uploaded and Submitted all supporting documentation</li></ol><h3>What Next</h3><p>Your Small Business Enablement Representative will review your application and attachments and will contact you &lt;within ?? days&gt; for any outstanding requirements, and to outline your next steps.</p><p>You can now begin to prepare for “Registering for Waste &amp; Water Collection”</p><h3>Need Help?</h3><p>Call your Small Business Enablement Team on 1800 123 456</p></div></div>");
$templateCache.put("easyToDoBusiness/premise-waste-collection/form/etb-premise-waste-collection-preform.html","<div class=\"row\"><div class=\"col-lg-12\"><a class=\"btn btn-default\" ui-sref=\"etb.premiseWasteCollection\">Exit task</a><snsw-page-heading title=\"Task 1: Register for wastewater services\"></snsw-page-heading><h3>Introduction</h3><p>You may need approval from your water provider to discharge commercial trade wastewater into a public sewer.</p><p>Commercial trade wastewater includes greasy wastewater from commercial cooking.</p><h3>What you’ll need</h3><p>Before applying for permission to discharge commercial wastewater, you must have:</p><ul><li>development approval for your premises, and</li><li>approval from the property owner of your premises.</li></ul><h3>How to register</h3><ol><li>Complete an application to discharge trade wastewater through <a href=\"https://www.sydneywater.com.au/SW/your-business/managing-trade-wastewater/commercial-trade-wastewater/index.htm\">Sydney Water</a></li><li>Sydney Water will contact you to discuss your application if they require additional information.</li><li>Your application will be assessed within 21 days.</li><li>You’ll be notified of the outcome of your application and/or any additional requirements.</li></ol><h3>Things to keep in mind….</h3><p>You must inform Sydney Water if you change the business activities on your premises, or if you want to cancel your permission to discharge commercial trade wastewater.</p><h3>Next steps</h3><p>After registering for wastewater services, you’ll need to request <a ui-sref=\"etb.premiseWasteCollectionRequest\">waste collection services</a>.</p><h3>Need Help?</h3><p>We can help you with this transaction. Feel free to call us on <a href=\"tel:137788\">13 77 88</a></p></div></div>");
$templateCache.put("easyToDoBusiness/premise-waste-collection/static/etb-premise-waste-collection-request.html","<div class=\"row\"><div class=\"col-lg-12\"><a class=\"btn btn-default\" ui-sref=\"etb.premiseWasteCollection\">Exit task</a><snsw-page-heading title=\"Task 2: Request waste collection services\"></snsw-page-heading><h3>Introduction</h3><p>You can organise the removal of your commercial waste though Parramatta City Council or a private provider. Commercial waste includes:</p><ul><li>effluent from a sewer, sewage facility, sullage pit or grease trap</li><li>trade waste from any building or demolition work, or industrial, chemical, trade or business process, and</li><li>garbage from wasted or spoiled food and other refuse.</li></ul><h3>What you’ll need</h3><p>Before arranging commercial waste removal, you must have:</p><ul><li>development approval for your premises, and</li><li>approval from the property owner of your premises.</li></ul><h3>How to request</h3><ol><li>Visit <a href=\"http://www.parracity.nsw.gov.au/work/doing_business_in_parra/business_services/commercial_waste_and_recycling/commercial_garbage_service\">Parramatta City Council website</a> for information on commercial garbage services.</li><li>Submit a request in writing, or via fax or email to Council.</li></ol><h3>Things to keep in mind….</h3><p>Requests made to Parramatta City Council for waste removal services must be made in writing by the owner, or the body corporate/strata manager of the property.</p><h3>Need Help?</h3><p>We can help you with this transaction. Feel free to call us on <a href=\"tel:137788\">13 77 88</a></p></div></div>");
$templateCache.put("easyToDoBusiness/premise-waste-collection/static/etb-premise-waste-collection-summary.html","<div class=\"row\"><div class=\"col-lg-12\"><a class=\"btn btn-default\" ui-sref=\"etb.premiseWasteCollection\">Exit task</a><snsw-page-heading title=\"Summary Page\"></snsw-page-heading><h3>What you have completed</h3><p>As part of the register for waste &amp; water collection, you should have completed the following:</p><ol><li>Organised commercial waste water management</li><li>Organised commercial garbage collection</li></ol><h3>What Next</h3><p>Once your applications have been approved for your waste collection, you will likely need to provide this information to your selected PCA as part the documentation required for your Occupation Certificate.</p><h3>Need Help?</h3><p>Please follow up with your selected vendors directly for waste removal services, if you have need for assistance or direction please call your Small Business Enablement Team on 1800 123 456</p></div></div>");
